    function exportToExcel() {
      // 
      const companyName = document.querySelector('.company-name').textContent;
      const companyAddress = document.querySelector('.company-address').textContent;
      const supplier = document.querySelector('.inquiry-info .info-row:nth-child(1) .info-value').textContent;
      const inquiryNo = document.querySelector('.inquiry-info .info-row:nth-child(2) .info-value').textContent;
      const date = document.querySelector('.inquiry-info .info-row:nth-child(3) .info-value').textContent;
      const table = document.querySelector('table');
      const footerCompany = document.querySelector('.footer .footer-row:nth-child(1)').textContent;
      const footerContact = document.querySelector('.footer .footer-row:nth-child(2)').textContent;
      const footerPhone = document.querySelector('.footer .footer-row:nth-child(3)').textContent;
      
      if (!table) return;
      
      // 
      const data = [];
      
      // 
      data.push([companyName]);
      data.push([companyAddress]);
      data.push([]); // 
      
      // 
      data.push(["", supplier]);
      data.push(["", inquiryNo]);
      data.push(["", date]);
      data.push([]); // 
      
      // 
      const headers = [];
      const thElements = table.querySelectorAll('th');
      thElements.forEach(th => headers.push(th.textContent));
      data.push(headers);
      
      // 
      const rows = table.querySelectorAll('tbody tr');
      rows.forEach(row => {
        const rowData = [];
        const cells = row.querySelectorAll('td');
        cells.forEach(cell => {
          // 
          if (cell.querySelector('input')) {
            rowData.push('');
          } else {
            rowData.push(cell.textContent);
          }
        });
        data.push(rowData);
      });
      
      data.push([]); // 
      
      // 
      data.push([footerCompany]);
      data.push([footerContact]);
      data.push([footerPhone]);
      
      // 
      const worksheet = XLSX.utils.aoa_to_sheet(data);
      
      // 
      worksheet['!cols'] = [
        { wch: 20 }, // 
        { wch: 20 }, // 
        { wch: 15 }, // 
        { wch: 15 }, // 
        { wch: 10 }, // 
        { wch: 10 }, // 
        { wch: 10 }, // 
        { wch: 10 }, // 
        { wch: 10 }, // 
        { wch: 12 }, // 
        { wch: 10 }  // 
      ];
      
      // 
      if (companyName) {
        worksheet['!merges'] = [
          { s: { r: 0, c: 0 }, e: { r: 0, c: 10 } }, // 
          { s: { r: 1, c: 0 }, e: { r: 1, c: 10 } }  // 
        ];
      }
      
      // 
      const workbook = XLSX.utils.book_new();
      XLSX.utils.book_append_sheet(workbook, worksheet, '');
      
      // Excel
      const today = new Date().toISOString().split('T')[0];
      XLSX.writeFile(workbook, "_" + today + ".xlsx");
    }
